import React from 'react'

export default {
  createDropDown: (options, value = null) => {
    Object.keys(options).map(key => {
      if (value === key) {
        return <option key={key} value={key} selected>{options[key]}</option>
      }
      return <option key={key} value={key}>{options[key]}</option>
    })
  }
}
